import React from "react";
import "./MoviesForm.css";

function SearchForm(props) {
    return (
        <ul className="moviesgallery__wrapper">
            <li className="card-movies">
                <div className="card-movies__wrapper-title">
                    <h2 className="card-movies__title">{props.name}</h2>
                    <span className="card-movies__time">{props.time}</span>
                </div>
                <img src={props.card.link} alt="btn-save" className="card-movies__image" />
                <button className="qqq">Сохранить</button>
            </li>
        </ul>
    );
}

export default SearchForm;
